//Home page
//A simple jsx element to display the home page

import { Navbar } from "../components/navbar";

export const Home = () => {
  return (
    <div className="HOME">
      <header></header>
      <body className="Home-body">
        <Navbar />
        <h1>Home</h1>
      </body>
    </div>
  );
};
